@dominique.showers’ battery is made of ionic willpower. With a mission more involved than “getting your foot in the door,” Dom aims for a seat at the head of the table – and not solely for personal gain. Dom started her career in the snow and skate industry and now holds not one, but two, executive level roles at Arc’teryx — bringing a powerful female voice to the top tier of the company. 

With her finger on an ever faster beating pulse, she’s adapted motherhood, relationships, and self-care to act as enhancers – not hindrances – to her career.

This week, we’re celebrating three inspiring women, beyond their shells: a VP matriarch, an ER nurse moonlighting as a pro-skier, and an Olympian with an engineering degree. Almost as layered as our ski jackets.

@drewruana making V16s look casual 👏🏼

Not pictured: 10 days and over 20 falls to send Insomniac, V16/8C+. Congrats Drew on pushing through!

